Material:1000-Denier Cordura<br>Application:<br> EQUIPMENT COVERED: <br>Canon GL-2 <br> Canon XM-2 <br> JVC GY-DV300 <br> Panasonic AG-DVC30 <br> Panasonic AG-DVC80 <br> Panasonic AG-DVX100 <br> Panasonic AG-DVX100P <br> Sony DCR-VX1000 <br> Sony DCR-VX2000 <br> Sony DCR-VX2100<br>Exterior Dimensions:20''L x 10''W x 9''H<br>Interior Dimensions:18''L x 7''W x 8.5''H<br>Weight:4 lbs.<br><br><br>・Customizable solution<br>・Durable  1000-denier Cordura<br>・Engineered for professionals<br>・Lightweight<br>・Superior performance through simplicity of design<br>・Padded pouches for tapes & batteries<br>・Pouches can be removed & worn on belt or over shoulder<br>・Exterior Cordura pocket<br>・Compact size<br>・Includes Quick Slick Mini (QSM) rain sea-spray & dust protector<br><br><br>The MINI-DV CAMERA CASES are designed for quick access to a large number of Mini-DV Cameras. The cradle is adjustable to fit your camera  giving it a secure ''home''  so regardless of case size  the camera will not shift  allowing any remaining space for accessories. High walls reduce its vulnerability to other equipment being transported in the case. <br><br> The CS-DV cases are soft-sided. The CS-DV2 and CS-DV3 have a cradle and removable padded pouch for extra batteries and tapes. The pouch can be used in the case  as a pocket  or used as a shoulder bag. The CS-DV4 comes with a cradle and two zippered stuff sacks. <br><br> The Quick Slick Mini (QSM) provides basic rain sea-spray and dust protection to keep you operating in the field. It uses the same neoprene gasket technology used in some of Porta Braces feature rich products. They're constructed of a tough nylon oxford material with waterproof coating and clear vinyl windows. Easy to stow away and quick to deploy. <br><br><br><br></DIV>
