Compatible Equipment:Panasonic AG-DVC80<br>Panasonic AG-DVC80H<br>Panasonic AG-DVX100<br>Panasonic AG-DVX100A<br>Panasonic AG-DVX100P<br>Panasonic AG-HVX200<br>Sony DCR-VX2000<br>Sony DCR-VX2100<br>Sony DSR-PD150<br>Sony DSR-PD170<br>Sony HDR-FX1<br>Sony HVR-Z1U<br>Dimension:Interior: 18.5'' L x 14.5'' W x 8'' H<br>Exterior: 20'' L x 16'' W x 11'' H<br>Weight:6.9 lbs.<br>Material:Exterior: 1000 denier Cordura fabric <br> Interior: Protective rigid frame <br> Interior: Veltex with thin layer of foam<br>Closure Type:Covered Zippers<br><br><br>・Designed for professionals<br>・Durable  1000-Denier Cordura fabric<br>・Large interior storage space<br>・Modular design for greater customization<br>・Video and audio in one case<br><br><br>The new modular BK-3LC backpack is designed for lightweight local use. It includes a standard removable front double-pocket and shoulder strap .<br><br>Improvements from the original BK design includes protective inner frame  zipper covers for wear spots on corners  more ergonomic and comfortable standard harness  and modular options for mini/handheld DV & still photography.<br><br>Module options include  a removable belt pouch which is ideal for filters  matte boxes or back-up batteries  an upgraded and enlarged tripod quiver  and also a laptop front pocket.</DIV>
