Material 1:External: All fabric exterior treated with a DWR coating while fabric underside is coated with PU for superior water resistance  YKK RC Fuse (abrasion resistant) zippers  420D velocity nylon  420D high-density nylon  600D brushed polyester  custom designed replaceable in-line skate wheels  Ultra Stretch pockets  antique nickel plated metal hardware  aluminum reinforcement  rubberized laminate  3D air mesh  3-ply bonded nylon thread<br>Material 2:Internal: PE board reinforced removable closed cell foam velex dividers  210D silver-toned nylon  PU backed velex liner  2x PU coated nylon 210T seam-sealed taffeta rain cover  big hole mesh  belly-o mesh  3-ply bonded nylon thread<br>Laptop Compartment:14.8x11x1.5'' / 37.6x28x3.8cm<br>Dimensions:External: 16x15.5x10'' / 40.6x39.4x25.4cm<br>Internal: 15x13x6.8'' / 38.1x33x17.3cm<br>Weight:8.1-9.2lbs / 3.7-4.2kg<br><br><br>・Top and front zippered access<br>・Extra long 42'' retractable handle for easy rolling<br>・Two external side pockets for flashes or water bottles<br>・Lockable zippers on both main compartments. Top compartment shown locked  (lock not included)<br>・Retractable handle slides through top lid handle to hold it open for easy access to gear<br>・Business card slot and zippered pocket on top lid for identification<br>・Dedicated compartments for both a laptop and a tablet<br>・Lockable high quality YKK RC-Fuse zippers<br>・Two zippered mesh pockets for secure storage in the top lid<br>・User replaceable wheels and handle<br>・The split shoulder strap is designed to slip over the handle of a larger roller  allowing you to roll two bags with one hand<br><br><br>The Think Tank Airport Navigator is perfect for photographers on the go and working out of the bag  it provides rapid  unencumbered access to gear and appeals to wedding  event and travel photographers. The split shoulder strap is designed to slip over the handle of a larger roller  allowing you to roll two bags with one hand.</DIV>
