Compatibility:Olympus 90-250mm f/2.8 lens<br>Material:Neoprene<br>Waterproof:Yes<br><br><br>・100% waterproof close-cell neoprene lens cover<br>・Protects the lens from bumps and scratches<br>・Easy to install and remove  leaving no residue on the lens<br>・Clear plastic windows over the auto focus and focus limiter controls and the distance scale<br>・Small hole on the last segment lines up with the red dot indicator  making it easy to quickly line up the lens with the camera mount even with the cover installed<br>・Compatible with the Olympus 90-250mm f/2.8 lens<br><br><br>The LensCoat Lens Cover (Realtree Max 4 HD) for Olympus 90-250mm f/2.8 Lens is a 100% closed-cell neoprene coat that protects the lens from bumps and scratches. It is ideal for nature  outdoor photographers  sports shooters and photojournalists. It also provides a thermal barrier  protecting your hands from cold lenses in lower temperatures. The cover is waterproof  providing protection in inclement weather. <br><br>The cover contains a clear plastic window through which you can access the auto focus and distance scale. There's also a handy orientation hole that aligns with the red dot on the lens for easy mounting even with the cover installed. The Realtree Advantage Max4 HD camouflage pattern offers maximum effectiveness in open terrain. The pattern incorporates cattails  millet  milo  corn stalks  sunflowers  oak and maple leaves  cedar and oak limbs  plus a variety of other plant life into the largest camouflage artwork on the market.</DIV>
