. It is reinforced with laminate panels while a hinged  extra wide opening provides fast  easy access to the interior storage areas. <br><br>Inside  you'll find that the bag has generous accommodation for your gear. Removable internal dividers help secure contents and create pockets for storing a mattebox  camera plate  follow focus  camera light  viewfinder  cables  spare lenses  etc. A mini pouch is able to hold up to four flash memory cards. The bag has dual-directional  easy-glide zippers to hold the contents safely inside of the bag. The internal LED lighting system illuminates the interior of the bag  making the contents easier to identify and organize when you're on the go. <br><br>Carrying options include an ergonomic neoprene shoulder strap and two interlocking carry handles. Additionally  twin brackets on the bottom allow quick connection of the Snaplock wheel and trolley system. On the exterior of the bag  a plastic exchangeable logo frame allows for personal branding of your new PD443. Since this bag meets the strict FAA specifications for carry-on luggage size  it is also well suited for air travel.</DIV>
