・A LensCoat for all seasons and habitats<br>・Forest Green Woodland Cameo<br>・Also Available in Realtree Hardwoods Snow & Advantage Max4 HD<br>・Sports shooters and photojournalist can get the benefits too<br>・Available in - Canon ''white'' and black<br><br><br>LensCoat Lens Covers... <br><br>Moving a big white (or black) lens near skittish wildlife is like waving your arms a sure way to flush your subject and ruin what could be a once-in-a-lifetime photo opportunity. LensCoat Lens Covers mask your 200 mm to 600 mm lens  giving you a better chance at getting the shot. <br><br> LensCoat Lens Covers are manufactured from 100% closed-cell neoprene  offering protection from bumps  jars and nicks  with a camouflage-pattern fabric cover. LensCoat Lens Covers also provide a thermal barrier  protecting your hands from cold lenses in lower temperatures. They are easy to install and remove  leaving no residue on the lens. And LensCoat lens covers are waterproof  providing protection in harsh conditions. <br><br> Other features include a clear  flexible UV-PVC window over the AF/IS/VR controls and the distance-scale window. The LensCoat also features custom holes that reveal the red-dot for easy alignment to the camera body without removing the cover. <br><br> LensCoat for the Nikon 600 f4 AFS I: <br><br> LensCoat N600 telephoto lens cover offers your valuable equipment some protection from scrapes and bumps  preserving its resale value. It also helps break up the shape of your lens  making it less noticeable to wildlife. <br><br> The LensCoat N600 features a clear plastic windows over the auto focus controls and also the distance scale. A small hole on the last segment lines up with the white dot indictor  making it easy to quickly line up your lens with camera mount even with the cover installed. <br><br></DIV>
